import heroes,{owners} from './bases/data/heroes';

const getHeroesById=(id)=>heroes.find(e=>e.id===id)
const hero1=getHeroesById(1);
console.log(hero1);

const getHeroeByOwner=(owner)=>heroes.filter(e=>e.owner===owner)
const heroesOwner=getHeroeByOwner("DC")
console.log(heroesOwner)
